    id: "547",
    key: "information",
    value: "The Glassy House at the French Atlantic Coast is home to the very first permanent indoor citywave. The concept combines surfing, a beach bar, a surf shop, as well as a gym and space for workshops under one roof. It is located at the Parc Commercial Océanis shopping center bringing the surf sensation to life for all visitors. Sourece: https://citywave.de/fr/citywave-locations/\r\n"
