    id: "571",
    key: "information",
    value: "https://www.labergerie-surfcamp.fr/le-projet/la-technologie/\r\n\r\nEnviron 1 KW/h par vague en moyenne. 600 vagues p/m.\r\nAvec cette technologie, la consommation d’énergie de la Bergerie Surf Camp est limitée au minimum. De plus, nous produirons une partie de l’énergie consommée grâce à des panneaux photovoltaïques installés sur les bâtiments et les locaux techniques.\r\n\r\nElle est celle qui correspond le mieux à la philosophie et à la qualité que nous recherchions. C’est également celle qui est la moins énergivore de toutes les technologies existantes. Sa technologie réside sur la mise en séquence de caissons pneumatiques. C’est un système de pression atmosphérique qui engendrent des houles océaniques naturelles."
