    value: "a:3:{s:7:\"widgets\";a:8:{i:0;a:9:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:173:\"[button font-size=\"20px\" funky=\"true\" title=\"true\" href=\"#\"]ABOUT US[/button]\n\n<h2 style=\"font-weight: 300;\">We’re a bold bunch of riders, look at us. We're awesome!</h2>\";s:20:\"text_selected_editor\";s:4:\"html\";s:5:\"autop\";b:1;s:12:\"_sow_form_id\";s:31:\"3885796195da743e48b44e205783090\";s:19:\"_sow_form_timestamp\";s:13:\"1571245771839\";s:22:\"so_sidebar_emulator_id\";s:19:\"sow-editor-44410000\";s:11:\"option_name\";s:17:\"widget_sow-editor\";s:11:\"panels_info\";a:8:{s:5:\"class\";s:31:\"SiteOrigin_Widget_Editor_Widget\";s:3:\"raw\";b:0;s:4:\"grid\";i:0;s:4:\"cell\";i:0;s:2:\"id\";i:0;s:9:\"widget_id\";s:36:\"6242cfab-8e0d-4efb-a104-f8f360c655c7\";s:5:\"style\";a:3:{s:27:\"background_image_attachment\";b:0;s:18:\"background_display\";s:4:\"tile\";s:16:\"featured_widgets\";s:0:\"\";}s:10:\"cell_index\";i:0;}}i:1;a:9:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:35:\"<h4>Meet the waves guide team</h4>\";s:20:\"text_selected_editor\";s:7:\"tinymce\";s:5:\"autop\";b:1;s:12:\"_sow_form_id\";s:31:\"7297907745da74422f09a9817348026\";s:19:\"_sow_form_timestamp\";s:13:\"1571243054115\";s:22:\"so_sidebar_emulator_id\";s:19:\"sow-editor-44410001\";s:11:\"option_name\";s:17:\"widget_sow-editor\";s:11:\"panels_info\";a:8:{s:5:\"class\";s:31:\"SiteOrigin_Widget_Editor_Widget\";s:3:\"raw\";b:0;s:4:\"grid\";i:0;s:4:\"cell\";i:0;s:2:\"id\";i:1;s:9:\"widget_id\";s:36:\"57356d75-af0d-4ed5-9394-6b7d815c3d2d\";s:5:\"style\";a:3:{s:27:\"background_image_attachment\";b:0;s:18:\"background_display\";s:4:\"tile\";s:16:\"featured_widgets\";s:0:\"\";}s:10:\"cell_index\";i:1;}}i:2;a:10:{s:4:\"name\";s:11:\"Stefan Thie\";s:7:\"new_tab\";s:2:\"on\";s:11:\"description\";s:440:\"Stefan is the man, the legend, the one - that made the project happen. He's the one pulling the strings, dealing with investors, filling the role of product-owner in the build team - harassing people who work on wave related things. While running a tight ship he aims for that 100% transparency and so far so good.\nStefan is a waves and wind dinosaur, and has traveled the world to visit and enjoy the best natural surf spots known to man. \";s:5:\"label\";s:8:\"uberdude\";s:4:\"tags\";s:34:\"vision, strategy, money, technical\";s:8:\"carousel\";a:1:{i:0;a:3:{s:2:\"id\";s:1:\"0\";s:4:\"type\";s:5:\"image\";s:3:\"url\";s:73:\"https://staging.waves.guide/wp-content/uploads/2019/10/stefan-864x486.jpg\";}}s:6:\"skills\";a:3:{i:0;a:3:{s:2:\"id\";s:1:\"0\";s:4:\"name\";s:7:\"surfing\";s:6:\"rating\";s:1:\"5\";}i:1;a:3:{s:2:\"id\";s:1:\"1\";s:4:\"name\";s:11:\"windsurfing\";s:6:\"rating\";s:1:\"5\";}i:2;a:3:{s:2:\"id\";s:1:\"2\";s:4:\"name\";s:11:\"kitesurfing\";s:6:\"rating\";s:1:\"4\";}}s:11:\"panels_info\";a:7:{s:5:\"class\";s:17:\"PW_Person_Profile\";s:4:\"grid\";i:1;s:4:\"cell\";i:0;s:2:\"id\";i:2;s:9:\"widget_id\";s:36:\"257986a1-121a-43b2-9140-7b30ba9dd89b\";s:5:\"style\";a:3:{s:27:\"background_image_attachment\";b:0;s:18:\"background_display\";s:4:\"tile\";s:16:\"featured_widgets\";s:0:\"\";}s:10:\"cell_index\";i:0;}s:22:\"so_sidebar_emulator_id\";s:26:\"pw_person_profile-44410002\";s:11:\"option_name\";s:24:\"widget_pw_person_profile\";}i:3;a:10:{s:4:\"name\";s:3:\"Bas\";s:7:\"new_tab\";s:0:\"\";s:11:\"description\";s:458:\"Bas was born on a surfboard and will always be found in a sauna after each surfsession. When Bas heard about waves.guide, he was 'all ear' ;-)\nSeriously: Bas his life has been hanging by a thread caused by a severe inner-ear infection and from that moment on, Bas builds his own wave surfboards, he prefers minimalism and therefore pure nature surfing. That is why our project is showing you where the closest 'natural surfspot' is from an artificial wave.\n\n\";s:5:\"label\";s:4:\"dude\";s:4:\"tags\";s:10:\"Consulting\";s:8:\"carousel\";a:1:{i:0;a:3:{s:2:\"id\";s:1:\"0\";s:4:\"type\";s:5:\"image\";s:3:\"url\";s:70:\"https://staging.waves.guide/wp-content/uploads/2019/10/bas-864x486.jpg\";}}s:6:\"skills\";a:2:{i:0;a:3:{s:2:\"id\";s:1:\"0\";s:4:\"name\";s:7:\"Surfing\";s:6:\"rating\";s:1:\"5\";}i:1;a:3:{s:2:\"id\";s:1:\"1\";s:4:\"name\";s:11:\"Windsurfing\";s:6:\"rating\";s:1:\"5\";}}s:11:\"panels_info\";a:7:{s:5:\"class\";s:17:\"PW_Person_Profile\";s:4:\"grid\";i:1;s:4:\"cell\";i:0;s:2:\"id\";i:3;s:9:\"widget_id\";s:36:\"5b4642e2-121e-4d92-8143-6a54643e54b5\";s:5:\"style\";a:3:{s:27:\"background_image_attachment\";b:0;s:18:\"background_display\";s:4:\"tile\";s:16:\"featured_widgets\";s:0:\"\";}s:10:\"cell_index\";i:1;}s:22:\"so_sidebar_emulator_id\";s:26:\"pw_person_profile-44410003\";s:11:\"option_name\";s:24:\"widget_pw_person_profile\";}i:4;a:10:{s:4:\"name\";s:5:\"Rinse\";s:7:\"new_tab\";s:0:\"\";s:11:\"description\";s:316:\"Rinse breathes wind and water, if there's a new toy to play with those (no not like that you pervert) Rinse is on it. As a result a massive amount of toys is piling out of his garage. Rinse is a general consultant and part of the building team. Rinse also has a particular good view on ways to monetize waves.guide. \";s:5:\"label\";s:4:\"dude\";s:4:\"tags\";s:31:\"marketing, creative, consulting\";s:8:\"carousel\";a:1:{i:0;a:3:{s:2:\"id\";s:1:\"0\";s:4:\"type\";s:5:\"image\";s:3:\"url\";s:72:\"https://staging.waves.guide/wp-content/uploads/2019/10/rinse-864x486.jpg\";}}s:6:\"skills\";a:3:{i:0;a:3:{s:2:\"id\";s:1:\"0\";s:4:\"name\";s:7:\"Surfing\";s:6:\"rating\";s:1:\"5\";}i:1;a:3:{s:2:\"id\";s:1:\"1\";s:4:\"name\";s:11:\"Kitesurfing\";s:6:\"rating\";s:1:\"5\";}i:2;a:3:{s:2:\"id\";s:1:\"2\";s:4:\"name\";s:11:\"Windsurfing\";s:6:\"rating\";s:1:\"5\";}}s:11:\"panels_info\";a:7:{s:5:\"class\";s:17:\"PW_Person_Profile\";s:4:\"grid\";i:1;s:4:\"cell\";i:1;s:2:\"id\";i:4;s:9:\"widget_id\";s:36:\"355116a3-04c8-4beb-a7f4-880a8af7ab0f\";s:5:\"style\";a:3:{s:27:\"background_image_attachment\";b:0;s:18:\"background_display\";s:4:\"tile\";s:16:\"featured_widgets\";s:0:\"\";}s:10:\"cell_index\";i:0;}s:22:\"so_sidebar_emulator_id\";s:26:\"pw_person_profile-44410004\";s:11:\"option_name\";s:24:\"widget_pw_person_profile\";}i:5;a:10:{s:4:\"name\";s:7:\"Andreas\";s:7:\"new_tab\";s:0:\"\";s:11:\"description\";s:2020:\"Andreas is a frequent flyer at Langenfeld but on occasion Andreas goes 'shopping' somewhere else ;-)\nIn May 2013, I met not only Nadine, Nelson's mother, in Arrifana (Pt), but also a very nice, somewhat corpulent, rented BMW-driving, 33-year-old, wind-wavesurfing, German named: Andreas.\n\nHe was fond of surfing and stored at various locations in Portugal, parts of his quiver.\nHe was certainly not bad in the water, but clearly not yet advanced. We have shared beautiful waves :-)\n\nHe asks me almost daily about the wave surf report / windsurf weather in Scheveningen and if I have surfed recently? After all, living in Wuppertal, if the predictions are favorable, then he would prefer to get into his VW camper. But he never actually did that until now. Yet he practices wave surfing every week. To be precise: on Monday nights at 19:00 .... in Langefeld, on a standing wave.\n\nCharacterwise, Andreas could be an Aussie: open, honest, curious and positive. I am not surprised that he, now also a father, together with his young family, still has the ambition to emigrate to Australia. Unfortunately, with residence permits today it’s no longer that simple.\n\nIn October 2018, just before the birth of Victoria, his first child, he went on a solo surf-campertrip of 6 weeks to the Goldcoast. And although he still lacked a bit of paddle condition / golf insight, he had become almost indistinguishable from an expert on the wave. The spray of his turns was so spectacular that the locals cheered and made him compliments.\n\nThey had not often seen a 39-year-old German who was able to surf so well :-) And when I see him surf, neither do I! Except maybe for that German teenager I met, who lived in Pavones (CR) and had received private education all his life around the best tides for surfing ‘the second longest left in the world’.\n\nSince our first meeting, Andreas has booked the standing wave at Langefeld for an hour with 7 other 'riders against the machine' ... on Monday evenings ... 20 times (a 34 euros) ...\";s:5:\"label\";s:8:\"Der Dude\";s:4:\"tags\";s:19:\"Consulting, Content\";s:8:\"carousel\";a:1:{i:0;a:3:{s:2:\"id\";s:1:\"0\";s:4:\"type\";s:5:\"image\";s:3:\"url\";s:74:\"https://staging.waves.guide/wp-content/uploads/2019/10/andreas-864x486.jpg\";}}s:12:\"social_icons\";a:1:{i:0;a:3:{s:2:\"id\";s:1:\"0\";s:4:\"icon\";s:11:\"fa-facebook\";s:4:\"link\";s:47:\"https://www.facebook.com/rideagainstthemachine/\";}}s:11:\"panels_info\";a:7:{s:5:\"class\";s:17:\"PW_Person_Profile\";s:4:\"grid\";i:1;s:4:\"cell\";i:1;s:2:\"id\";i:5;s:9:\"widget_id\";s:36:\"9bc79383-db0e-4634-a244-ec5e4f962779\";s:5:\"style\";a:3:{s:27:\"background_image_attachment\";b:0;s:18:\"background_display\";s:4:\"tile\";s:16:\"featured_widgets\";s:0:\"\";}s:10:\"cell_index\";i:1;}s:22:\"so_sidebar_emulator_id\";s:26:\"pw_person_profile-44410005\";s:11:\"option_name\";s:24:\"widget_pw_person_profile\";}i:6;a:10:{s:4:\"name\";s:5:\"Felix\";s:7:\"new_tab\";s:0:\"\";s:11:\"description\";s:582:\"Felix was born on a windsurfboard but has come to appreciate wavesurfing as well in the last couple of years. And although he denies it - his mission in life is all about getting his kids to step on a board and stay there, forever. Not a week goes by without us receiving a picture from Felix of one of his kids; power jibing, bodyboarding or skimboarding. That ambition has consequences: He managed to be (a little bit) too late for every photo-shoot we have had so far. It could also be that he was playing with his new TAKA windsurfsails or one of his new surfboards himself ;-)\n\";s:5:\"label\";s:4:\"dude\";s:4:\"tags\";s:20:\"Consulting, Reviewer\";s:8:\"carousel\";a:1:{i:0;a:3:{s:2:\"id\";s:1:\"0\";s:4:\"type\";s:5:\"image\";s:3:\"url\";s:72:\"https://staging.waves.guide/wp-content/uploads/2019/10/felix-864x486.jpg\";}}s:6:\"skills\";a:3:{i:0;a:3:{s:2:\"id\";s:1:\"0\";s:4:\"name\";s:7:\"Surfing\";s:6:\"rating\";s:1:\"5\";}i:1;a:3:{s:2:\"id\";s:1:\"1\";s:4:\"name\";s:11:\"Windsurfing\";s:6:\"rating\";s:1:\"5\";}i:2;a:3:{s:2:\"id\";s:1:\"2\";s:4:\"name\";s:9:\"Parenting\";s:6:\"rating\";s:1:\"5\";}}s:11:\"panels_info\";a:7:{s:5:\"class\";s:17:\"PW_Person_Profile\";s:4:\"grid\";i:1;s:4:\"cell\";i:2;s:2:\"id\";i:6;s:9:\"widget_id\";s:36:\"b4d66ea8-a19d-41a0-b9af-f991c8ce09d3\";s:5:\"style\";a:3:{s:27:\"background_image_attachment\";b:0;s:18:\"background_display\";s:4:\"tile\";s:16:\"featured_widgets\";s:0:\"\";}s:10:\"cell_index\";i:0;}s:22:\"so_sidebar_emulator_id\";s:26:\"pw_person_profile-44410006\";s:11:\"option_name\";s:24:\"widget_pw_person_profile\";}i:7;a:10:{s:4:\"name\";s:6:\"Tobias\";s:7:\"new_tab\";s:0:\"\";s:11:\"description\";s:604:\"When Stefan came to me and told me he was toying with the idea to create a website about man-made-waves, I told him that if he really wanted to do that, he should go for it, immediately, no waiting any longer - start asap, and not to do it half-assed, but tdo it properly right-away!\n\nA little over a week later he called me and asked if I wanted to join him on this adventure, and pick up the development part. \nI asked him: \"when do you want to start?\" to which he replied: \"rightaway...\". \nThis made me smirke a bit, he politely added: 'well, you told me to start asap'. \nIt was impossible to refuse. \";s:5:\"label\";s:9:\"crea dude\";s:4:\"tags\";s:30:\"concept, creative, development\";s:8:\"carousel\";a:1:{i:0;a:3:{s:2:\"id\";s:1:\"0\";s:4:\"type\";s:5:\"image\";s:3:\"url\";s:73:\"https://staging.waves.guide/wp-content/uploads/2019/10/tobias-864x486.jpg\";}}s:6:\"skills\";a:3:{i:0;a:3:{s:2:\"id\";s:1:\"0\";s:4:\"name\";s:11:\"windsurfing\";s:6:\"rating\";s:1:\"4\";}i:1;a:3:{s:2:\"id\";s:1:\"1\";s:4:\"name\";s:12:\"forward loop\";s:6:\"rating\";s:1:\"0\";}i:2;a:3:{s:2:\"id\";s:1:\"2\";s:4:\"name\";s:10:\"snorkeling\";s:6:\"rating\";s:1:\"4\";}}s:11:\"panels_info\";a:7:{s:5:\"class\";s:17:\"PW_Person_Profile\";s:4:\"grid\";i:1;s:4:\"cell\";i:2;s:2:\"id\";i:7;s:9:\"widget_id\";s:36:\"985211ea-a795-4f25-b373-d0a1d73ef596\";s:5:\"style\";a:3:{s:27:\"background_image_attachment\";b:0;s:18:\"background_display\";s:4:\"tile\";s:16:\"featured_widgets\";s:0:\"\";}s:10:\"cell_index\";i:1;}s:22:\"so_sidebar_emulator_id\";s:26:\"pw_person_profile-44410007\";s:11:\"option_name\";s:24:\"widget_pw_person_profile\";}}s:5:\"grids\";a:2:{i:0;a:4:{s:5:\"cells\";i:1;s:5:\"style\";a:4:{s:27:\"background_image_attachment\";b:0;s:18:\"background_display\";s:4:\"tile\";s:11:\"row_stretch\";s:4:\"full\";s:14:\"cell_alignment\";s:10:\"flex-start\";}s:5:\"ratio\";i:1;s:15:\"ratio_direction\";s:5:\"right\";}i:1;a:4:{s:5:\"cells\";i:3;s:5:\"style\";a:5:{s:27:\"background_image_attachment\";b:0;s:18:\"background_display\";s:4:\"tile\";s:13:\"bottom_margin\";s:4:\"75px\";s:11:\"row_stretch\";s:4:\"full\";s:14:\"cell_alignment\";s:10:\"flex-start\";}s:5:\"ratio\";i:1;s:15:\"ratio_direction\";s:5:\"right\";}}s:10:\"grid_cells\";a:4:{i:0;a:4:{s:4:\"grid\";i:0;s:5:\"index\";i:0;s:6:\"weight\";i:1;s:5:\"style\";a:0:{}}i:1;a:4:{s:4:\"grid\";i:1;s:5:\"index\";i:0;s:6:\"weight\";d:0.33333333333332998;s:5:\"style\";a:0:{}}i:2;a:4:{s:4:\"grid\";i:1;s:5:\"index\";i:1;s:6:\"weight\";d:0.33333333333332998;s:5:\"style\";a:0:{}}i:3;a:4:{s:4:\"grid\";i:1;s:5:\"index\";i:2;s:6:\"weight\";d:0.33333333333332998;s:5:\"style\";a:0:{}}}}"
