    value: "http://www.kswaveco.com/developer-inquiry\r\n\r\nKelly Slater Wave Company (KSWC), the World Surf League (WSL), Big Sky Wave Developments, and real estate firm Meriwether Companies are collaborating on a sports and wellness resort community in La Quinta, California. Coral Mountain will include a hotel, residences, private club, dining venues, sports facilities, and a 20-acre surfable wave basin.\r\n"
