    value: "Furthermore, the project is powered by 100 percent renewable energy. Citywave, the German company behind the project, has already constructed standing waves in over 13 different locations across Europe and Asia, including Munich, Madrid, and Tokyo. \r\n@Do we have them all on wavesguide? \r\nTheir patented “deep water” technology allows the use of real surfboards with full-sized fins and the wave size and shape can be adjusted at the push of a button, catering to pros and Joes alike.\r\nSource: https://www.theinertia.com/surf/check-out-the-rippable-section-on-this-giant-new-citywave-in-lake-chelan-washington/"
