    id: "1020",
    key: "information",
    value: "https://www.surfparkcentral.com/cannon-beach-mesa-az-begins...\r\nCannon Beach, a 37-acre mixed-use development is anchored by Revel Surf, a 3.3-acre surf park that will feature Swell MFG’s Traveling Surf Technology and UNIT Surf Pool’s Stationary Rapid Surf Technology together. Revel Surf was created in collaboration with X Games Gold Medalist, and former World Ranked Pro Surfer, Shane Beschen.\r\n\r\nThe First Surf Park Development to Feature Both a Large Traveling Wave and a Stationary Rapid Surf Wave in One Park\r\nReally?!\r\nhttps://www.instagram.com/reel/CNNEBxQKWoQ/?igshid=uacblmyiwqxs"
